jQuery.extend(jQuery.fn.dataTableExt.oSort,{"time-uni-pre":function(e){var t;if(-1<e.toLowerCase().indexOf("am")||-1<e.toLowerCase().indexOf("pm")&&12===Number(e.split(":")[0]))for(t=e.toLowerCase().split("pm")[0].split("am")[0];-1<t.indexOf(":");)t=t.replace(":","");else if(-1<e.toLowerCase().indexOf("pm")||-1<e.toLowerCase().indexOf("am")&&12===Number(e.split(":")[0])){t=Number(e.split(":")[0])+12;for(var r=e.toLowerCase().split("pm")[0].split("am")[0].split(":"),i=1;i<r.length;i++)t+=r[i].trim().toString()}else for(t=e.replace(":","");-1<t.indexOf(":");)t=t.replace(":","");return Number(t)},"time-uni-asc":function(e,t){return e<t?-1:t<e?1:0},"time-uni-desc":function(e,t){return e<t?1:t<e?-1:0}});